ackground":3423213878},"darkThemeColorPalette":{"baseBackground":4278323996,"raisedBackground":4278851894,"additiveBackground":725971913,"textPrimary":4292930042,"textSecondary":4289379807,"invertedBackground":4286423523,"overlayBackground":3423213878},"colorSampledDescriptionBodyText":{"content":"The official video for Never Gonna Give You Up by Rick Astley. \n\nNever: The Autobiography  OUT NOW! \nFollow this link to get your copy and listen to Ricks Never playlist  #RickAstleyNever\nhttps://linktr.ee/rickastleynever\n\nNever Gonna Give You Up was a global smash on its release in July 1987, topping the charts in 25 countries including Ricks native UK and the US Billboard Hot 100.  It also won the Brit Award for Best single in 1988. Stock Aitken and Waterman wrote and produced the track which was the lead-off single and lead track from Ricks debut LP Whenever You Need Somebody.  The album was itself a UK number one and would go on to sell over 15 million copies worldwide.\n\nThe legendary video was directed by Simon West  who later went on to make Hollywood blockbusters such as Con Air, Lara Croft  Tomb Raider and The Expendables 2.  The video passed the 1bn YouTube views milestone on 28 July 2021.\n\nSubscribe to the official Rick Astley YouTube channel: https://RickAstley.lnk.to/YTSubID\n\nFollow Rick Astley:\nFacebook: https://RickAstley.lnk.to/FBFollowID \nTwitter: https://RickAstley.lnk.to/TwitterID \nInstagram: https://RickAstley.lnk.to/InstagramID \nWebsite: https://RickAstley.lnk.to/storeID \nTikTok: https://RickAstley.lnk.to/TikTokID\n\nListen to Rick Astley:\nSpotify: https://RickAstley.lnk.to/SpotifyID \nApple Music: https://RickAstley.lnk.to/AppleMusicID \nAmazon Music: https://RickAstley.lnk.to/AmazonMusicID \nDeezer: https://RickAstley.lnk.to/DeezerID \n\nLyrics:\nWere no strangers to love\nYou know the rules and so do I\nA full commitments what Im thinking of\nYou wouldnt get this from any other guy\n\nI just wanna tell you how Im feeling\nGotta make
